            a: false,

            d: false,
        };
        window.addEventListener('keydown', (event) => {
            const key = event.key.toLowerCase();
            if (keysPressed.hasOwnProperty(key)) {

            }
        });

            const key = event.key.toLowerCase();
            if (keysPressed.hasOwnProperty(key)) {
                keysPressed[key] = false;
            }
        });

        // ✅ render loop
        function animate(t) {
            const speed = 0.05;

            if (keysPressed.w) bed_mesh.position.z -= speed;
            if (keysPressed.s) bed_mesh.position.z += speed;
            if (keysPressed.a) bed_mesh.position.x -= speed;
            if (keysPressed.d) bed_mesh.position.x += speed;

            bed_mesh.rotation.y = t * 0.001; // หมุนเตียง
            renderer.render(scene, camera);
            requestAnimationFrame(animate);
        }
        animate(0);
